    name: 'name',
    subject: 'subject',
    status: 'status',
  },
];

const Home: FC = memo(function Home() {
  const [page, setPage] = useState(0);

  useEffect(() => {
    const fechData = async () => {
      try {
        const res = await fetch(
          'https://hn.algolia.com/api/v1/search?tags=front_page&page=1',
        );

        const datahn = await res.json();
        console.log(datahn);
      } catch (e) {
        console.error(e);
      }
    };

    fechData();
  }, []);

  console.log('render');

  const nextPage = () => setPage(page + 1);
  return (
    <div className={styles.wrapper}>
      <Menu />
      <div className={styles.container}>
        <Header />

        <List data={DATA} />

        <div onClick={nextPage}></div>

        <Footer />
      </div>
    </div>
  );
});

export default Home;
